import React from 'react';
import PropTypes from 'prop-types';

const Error = ({mensaje}) => {
    return (  
        <p className="my-3 p-4 text-center alert alert-danger alert-link">{mensaje}</p>
    );
}

Error.propTypes = {
    mensaje: PropTypes.string.isRequired
}
 
export default Error;
